import { combineReducers } from "@reduxjs/toolkit";
import {
  ANSWER_QUESTION,
  START_TIMER,
  END_TIMER,
  PREVIOUS_QUESTION,
  NEXT_QUESTION,
} from "./actions";
import { initialState } from "./initialState";

function answer(state: string = "", { type, payload }) {
  switch (type) {
    case ANSWER_QUESTION:
      return state;

    default:
      return state;
  }
}

function time(state: number = 0, { type, payload }) {
  switch (type) {
    case START_TIMER:
      return state;

    case END_TIMER:
      return state;

    default:
      return state;
  }
}

const question = combineReducers({
  answer,
  time,
});

function current(state = 0, { type, payload }) {
  switch (type) {
    case PREVIOUS_QUESTION:
      return state;
    case NEXT_QUESTION:
      return state;

    default:
      return state;
  }
}

const exam = combineReducers({
  question,
  current,
});

export const rootReducer = combineReducers({
  exam,
});

export default rootReducer;
